// Import the React and ReactDOM libraries
import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Switch, Link, Route } from "react-router-dom";
import AboutMeScreen from "./aboutme";
import "./style.css"
// Create a react component
export const App = () => {
  return (
    <BrowserRouter>
      <div
        style={{
          backgroundImage: `url('c.jpg')`,
          position: "absolute",
          width: "100vw",
          height: "100vh",
        }}
        id="root"
      >
        <h1
          style={{
            position: "relative",
            top: "270px",
            fontFamily: "Brush Script Std, cursive",
            textAlign: "center",
            color: "#7a00e0",
          }}
        >
          Hello, I'm Dariia Kulikova
        </h1>
        <h3
          style={{
            position: "relative",
            top: "250px",
            fontFamily: "Brush Script Std, cursive",
            textAlign: "center",
            color: "#7a00e0",
          }}
        >
          developer
        </h3>
        <a href="https://github.com/dariiakulik">
          <img
            style={{
              width: "30px",
              margin: "30px auto",
              position: "relative",
              top: "220px",
              left: "570px",
            }}
            src="github.png"
          />
        </a>
        <a href="https://www.linkedin.com/in/dariia-kulikova-6b48ab172">
          <img
            style={{
              width: "30px",
              margin: "30px auto",
              position: "relative",
              top: "220px",
              left: "590px",
            }}
            src="Linkedin.png"
          />
        </a>
        <a href="https://resume.io/r/zeT2qZVHx">
          <img
            style={{
              width: "30px",
              margin: "30px auto",
              position: "relative",
              top: "220px",
              left: "610px",
            }}
            src="cv.jpeg"
          />
        </a>
        <a
          href="/portfolio"
          className="button-portfolio"
        >
          {" "}
          Portfolio
        </a>
        <Link
          to="/aboutme"
          className="button-aboutme"
        >
          {" "}
          About me
        </Link>

        <a
          href="/contact"
          className="button-contact"
        >
          {" "}
          Contact
        </a>
      </div>
      <Switch>
        <Route exact path="/aboutme">
          <AboutMeScreen />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};

// Take the react component and show it on the screen

ReactDOM.render(<App />, document.querySelector("#root"));
